// Welcome.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

const Welcome = () => {
    const navigate = useNavigate();

    return (
        <div className="welcome-container min-h-screen flex flex-col items-center justify-center bg-gradient-to-r from-blue-400 to-blue-500 px-4 sm:px-8">
            <h1 className="text-3xl sm:text-4xl md:text-5xl font-bold text-white mb-6 sm:mb-8 text-center">
                Welcome to CareLink!
            </h1>
            <div className="flex flex-col sm:flex-row gap-4">
                <button
                    onClick={() => navigate('/labtest')}
                    className="w-full sm:w-auto px-6 py-3 bg-white text-blue-500 font-semibold rounded-lg shadow-md hover:bg-blue-100 transition duration-200 text-lg md:text-xl"
                >
                    Lab Test
                </button>
                <button
                    onClick={() => navigate('/chatbot')}
                    className="w-full sm:w-auto px-6 py-3 bg-white text-blue-500 font-semibold rounded-lg shadow-md hover:bg-blue-100 transition duration-200 text-lg md:text-xl"
                >
                    Chatbot
                </button>
            </div>
        </div>
    );
};

export default Welcome;
